/* ************************** */
/*    ファイルのインポート     */
/* ************************** */
// 無操作の頂点シェーダー
import VERT_NORMAL from "./assets/main.vert"
// 無操作の頂点シェーダー
import FRAG_NORMAL from "./assets/main.frag"
import FRAG_GRAYSCAL from "./assets/grayscale.frag"

// ファイルリスト
export let fileList = [
  {
    "vert": VERT_NORMAL,
    "frag": FRAG_GRAYSCAL,
    "remarks": "白黒のフィルタ"
  },
  {
    "vert": VERT_NORMAL,
    "frag": FRAG_FILE_01,
    "remarks": "なにかコメントがあれば(どういったフィルタかの説明など)"
  },
]
